import React from "react";

const Header = () => {
  return (
    <div className="row navbar_upper">
      <div class="row">
        <div class="col-xl-2 col-lg  col-md col-sm socials">FACEBOOK</div>
        <div class="col-xl-2 col-lg  col-md col-sm socials">INSTAGRAM</div>
        <div class="col-xl-2 col-lg  col-md col-sm socials">TELEGRAM</div>
        <div class="col-xl-2 col-lg  col-md col-sm socials">TWITTER</div>
        <div class="col-xl-2 col-lg  col-md col-sm socials">GMAIL</div>
      </div>
    </div>
  );
};

export default Header;
